import React  from "react";
import CopyrightIcon from '@material-ui/icons/Copyright';
const Footer=()=>{
    return (
        <>
        <footer className="w-100 bg-light text-center">

            <p> 2020<CopyrightIcon/>react project </p>

        </footer>
        </>

    );

}
export default Footer;
